import Jokes from "./Jokes";

export default function RenederJokes(){
    return(
        <>
            <Jokes setup = "astraunotes use linux" punchline ="they can't open windows in the space" />
            <Jokes setup = "does " punchline ="hahaha" />
            <Jokes setup = "do humans" punchline ="I don't know" />
            <Jokes setup = "any" punchline ="jokes" />
        </>
    )
}
